import React from 'react';
import data from "../response.json"

export default (props) => {

    let { data } = props
    console.log(data)
    return (
        <div>
            {
                data && <div>
                    {
                        data.children.map((item, index)=>{
                            return(
                                <li> {item.name} ({item.path})</li>
                            )
                        })
                    }
                </div>
            }

<style jsx>{`
        .App {
          text-align: left;
          margin: 30px;
        }
        .flex{
        justify-content: space-around;
        display: flex;
        }
        ul{
          padding: 0px;
        }
        li{
          list-style-type: none;
          margin-bottom: 20px;
        }
        a{
          text-decoration: none;
          color: black;
        }
        
      `}</style>
        </div>
    )
}
